import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="text-center">
      <h2>Welcome to Music Hub</h2>
      <p>Your destination for exploring, listening, and enjoying music.</p>
      <img src="./images/music-banner.jpg" alt="Music Banner" className="img-fluid" />
    </div>
  );
};

export default Home;
